$ser_content = 'a:2:{s:7:"CONTENT";s:0:"";s:4:"VARS";a:3:{i:37084;a:24:{s:2:"ID";s:5:"37084";s:11:"ACTIVE_FROM";s:15:"1 июля 2020";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:13:"Галина ";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"37084:21";s:20:"PROPERTY_EMAIL_VALUE";s:23:"Lushnikovaspb@yandex.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"37084:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"37084:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:796:"Хотим с мужем выразить свою огромную благодарнось Ольге Евгеньевне за нашего сыночка! Это очень приятная и красивая женщина, чуткая, отвечающая на все вопросы и знающая свое дело. Всегда была на связи, если возникали какие-то вопросы. На каждом этапе рассказывала, что и как будет происходить, ничего лишнего, все по делу и результат не заставил долго себя ждать! Если решимся на еще одно маленькое чудо, то только к ней! Спасибо огромное!";s:4:"TYPE";s:4:"TEXT";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"37084:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"37084:26";s:24:"PROPERTY_LAST_NAME_VALUE";s:16:"Венцевич";s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"37084:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"37084:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";i:0;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"37084:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:23919;a:24:{s:2:"ID";s:5:"23919";s:11:"ACTIVE_FROM";s:21:"3 декабря 2018";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:12:"Оксана";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23919:21";s:20:"PROPERTY_EMAIL_VALUE";s:17:"simoksa@yandex.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23919:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23919:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:1743:"Хочу выразить огромную благодарность и низкий поклон специалисту с Большой Буквы Близнюковой Наталье Сергеевне. Именно благодаря этому высококвалифицированному врачу наша семья обрела Счастье после 15 лет бесплодия. Благодаря усилиям Натальи Сергеевны в 2014 году в нашей семье появился долгожданный первенец Рома. Спустя 2,5 года, когда встал вопрос о том, что хотим еще детей я даже не раздумывая обратилась к Наталье Сергеевне и в 2018 году наша семья стала еще вдвойне счастливее - у нас появилась доченька Мария. Мечта нашей семьи сбылась благодаря профессионализму, полной отдаче, высокой компетентности и прекрасным человеческим качествам Близнюковой Натальи Сергеевны, которая не жалея личного времени помогала не только подготовиться к протоколам ЭКО, забеременеть, но и выносить беременность. Ни разу она не отказала в совете, консультации. Спасибо ВАМ НАталья Сергеевна! Без Вас я бы никогда не познала радость материнства.  Оксана Ставрополь.";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23919:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23919:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23919:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23919:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23919:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:51917;a:24:{s:2:"ID";s:5:"51917";s:11:"ACTIVE_FROM";s:15:"1 июня 2022";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:12:"Марина";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"51917:21";s:20:"PROPERTY_EMAIL_VALUE";s:28:"Marinochka7777779@gmail.com ";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"51917:22";s:25:"PROPERTY_SPECIALIST_VALUE";i:25;s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"51917:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:443:"Большое спасибо Радионовой Виктории Вадимовне! Благодаря Вашей работе я стала мамо